import React, { Component } from 'react'

export default class YoutubeVideo extends Component {
    constructor() {
        super();
        this.state = {
            videoURL: ""
        }
    }
    componentWillMount() {


        this.setState({ videoURL: this.props.videoURL });
    }
    render() {
        return (
            <div>
                {this.state.videoURL}
            </div>
        )
    }
}
